'use strict';

var ExplorePage = require('../models/pages/ExplorePage.js');

const explorePage = async ({ page, selectors, grafanaVersion, request }, use, testInfo) => {
  const explorePage2 = new ExplorePage.ExplorePage({ page, selectors, grafanaVersion, request, testInfo });
  await explorePage2.goto();
  await use(explorePage2);
};

exports.explorePage = explorePage;
